import Logo from "../../shared/Logo/Logo";
import Input from "../../shared/Input/Input";
import DarkButton from "../../shared/DarkButton/DarkButton";
import LightButton from "../../shared/LightButton/LightButton";
import TitleText from "./components/TitleText/TitleText";

import user from "../../assets/images/icons/user.svg";
import lock from "../../assets//images/icons/lock.svg";

const Blog = () => {
  return (
    <div className="log-in">
      <Logo />
      <TitleText
        title="Let’s you sign in"
        suptitle="Welcome back. You’ve been missed!"
        variant={1}
      />
      <form action="">
        <Input
          type="text"
          icon={user}
          iconType="image"
          placeholder="Username"
          mt="24"
          mb="16"
        />
        <Input
          type="password"
          icon={lock}
          iconType="image"
          placeholder="Password"
          mb="16"
        />
        <a href="/forgot-password">Forgot your password?</a>
        <DarkButton children="Log in" type="submit" mt="32" mb="16" />
        <LightButton children="Create an account" type="button" />
      </form>
    </div>
  );
};

export default Blog;
